    false,nt"url": null,nt"notes": "This map layer shows elevation contour
    lines for Puerto Rico and the U.S. Virgin Islands. The map layer was derived from
    the 100-meter resolution elevation data set which is published by the National Atlas
    of the United States, and is in the same Albers Equal-area Conic projection as that
    source data set. Contour intervals match the steps used in the National Atlas Color-Sliced
    Elevation data sets. Contours were adjusted so that they are in the proper relationship
    to National Atlas 1:1,000,000-scale lakes, reservoirs, and wide (double-line) streams.",nt"license_title":
